import React from 'react';
import logo from './logo.svg';
import './App.scss';
import Sidebar from './components/Sidebar';
import ISidebarKeyValues from './interfaces/ISidebarKeyValues';

function App() {

  const sidebarItems: ISidebarKeyValues[] = [
    {
      id: 1,
      name: 'Google',
      url: 'www.google.co.uk'
    },
    {
      id: 2,
      name: 'YouTube',
      url: 'https://www.youtube.com/'
    }
  ]

  return (
    <div className="App">
      <Sidebar title='Page 1' titleLink='/page1' sidebarItems={sidebarItems} />
    </div>
  );
}

export default App;
